    {message: 'Its My Life', likes: 60} ,
    {message: 'HELLOMOTHERFUCKER', likes: 12 },
    {message: 'CHE NAHYI??', likes: 22 },
]

let postElement = postData.map( post => <Post message={post.message} likes={post.likes}/>)
const MyPosts = () => {
    return (
        <div className={s.items}>
            <div>My posts</div>
            <textarea>New post</textarea>
            <button>add post</button>
            {postElement}
        </div>
    );
};

export default MyPosts;
